window.bookSummaryJSON = "<p><b>I'm human. </b><b><i>They're not</i></b><b>. I'm afraid. </b><b><i>They're not.</i></b></p> <p>We're mated. We're whole. And together, we're going to change the Pack forever.</p> <p>Violence thrust me into this world. My past defined me. I was on the run, constantly evading an adolescence loaded with heartbreak and fear. And then the end came. But with it, I found a new beginning.</p> <p>Three mates, three alphas, all mine, to have and to hold. Their protection gives me a future, and their love gives me wings. But the best intentions can still lead us to hell. For the first time in my life, I have a future worth fighting for. Only, that doesn't take away my living demons. When they come for me, which they will, I'm no longer alone.</p> <p>Can I survive if fate has given me an expiration date that I avoided a decade ago?</p>"; 
